import React from "react";
import { Box } from "@chakra-ui/react";

import Sidebar from "./Sidebar";

function Dashboard({}) {
  return (
    <div className="dashboard">
      <Sidebar />
      <Box bg="tomato" w="80vw" h="100vh"></Box>
    </div>
  );
}

export default Dashboard;
